  //   console.log(resposta.value.length)
  // })

  return (
    <>
      <ul>
        <li>sexo</li>
        <li>sexo</li>
        <li>sexo</li></ul>
      <li>sexo</li>
      <li>sexo</li>
      <li>sexo</li>

    </>
  )
}
